import React from "react";
import Header from "./components/Header.js";
import ScoreBoard from "./components/ScoreBoard.js";
import ChatRoom from "./components/ChatRoom.js";
import GameList from "./components/GameList.js";

function App() {
  return (
    <div className="app">
      <Header />
      <GameList />
      <ScoreBoard />
      <ChatRoom />
    </div>
  );
}

export default App;
